import { useState } from 'react';
import { Link } from 'react-router-dom';
import {ShoppingOutlined, MedicineBoxOutlined ,PartitionOutlined } from '@ant-design/icons';
import Makeups from './Makeups';
import Medicine from './Medicine';

const Nav = () => {
  const [isVisible, setVisible] = useState(false);
  const handleDisplay=()=>{
    setVisible(!isVisible)
  }

  return (
    <div>
    <Link to="/makeups"><ShoppingOutlined style={{fontSize: '30px', color: 'orange' }} onClick={handleDisplay}/> 化妆护肤{isVisible?<Makeups/>:""}</Link>
    <Link to="/medicine"><MedicineBoxOutlined style={{ fontSize: '30px', color: 'orange' }} onClick={handleDisplay}/>药品保健{isVisible?<Medicine/>:""}</Link>
    <Link to="/baby"><MedicineBoxOutlined style={{ fontSize: '30px', color: 'orange' }} onClick={handleDisplay}/>母婴产品{isVisible?<Makeups/>:""}</Link>
    <Link to="/others"><PartitionOutlined style={{ fontSize: '30px', color: 'orange' }} onClick={handleDisplay}/> 其他{isVisible?<Makeups/>:""}</Link> 
    </div>
  );
}; 
export default Nav;
